import React from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../components/Header';

function Home() {
	let navigate = useNavigate();

	return (
		<div>
			<Header />
			<div
				onClick={() => navigate('/create-game/player-select')}
				className='custom-bg-gray w-48 rounded-lg py-1 text-center  text-white hover:cursor-pointer md:ml-5 md:text-lg'
			>
				Back
			</div>
			<div
				onClick={() => navigate('/create-game/player-select')}
				className='custom-bg-gray w-48 rounded-lg py-1 text-center  text-white hover:cursor-pointer md:ml-5 md:text-lg'
			>
				Back
			</div>
		</div>
	);
}

export default Home;
